INSERT INTO `businesses` VALUES (1,'Accountancy',200,'C','Accountancy is a profession where the firm computes, classifies, records, and summarize financial data to keep and maintain fiscal records according to established bookkeeping and accounting procedures and systems. Evaluates records for accuracy of balances, postings, calculations, and other records pertaining to business or operating transactions and reconciles, or notes discrepancies. '),(2,'Advertising',200,'C','An advertising agency is focused on assisting small business owners to create knockout advertising campaigns that get the results they want and need from their tight advertising budgets. Many advertising agencies concentrate on big corporations with massive advertising budgets, leaving small business owners to figure out how to best advertise their products and services. '),(3,'Aircraft Dealer',1000000,'H','An Aircraft dealer works with high net worth clients and their representatives mediating the buying and selling of aircraft or the chartering of an aircraft. This role is challenging and pressurized but can also be very lucrative and offers an unlimited income. It is a prestigious role that provides lots of opportunity in an exciting fast paced environment. '),(4,'Antique Dealer',5000,'H','As an antique dealer you can profit from your passion in a number of ways. In addition to selling antiques, you might offer services such as restoring antiques or antiques consulting. When you take trips to go antiquing, it will no longer be just for fun, it will be for business. Antique dealers buy items one-at-a-time. Antiques are more in demand than ever before. While many people inherit treasured antiques, those who collect antiques are usually wealthy.'),(5,'Auction House',20000,'H','A company that facilitates the buying and selling of assets, such as works of art and collectibles. An auction house may sometimes refer to the facility that an auction is taking place in, most commonly refers to the company running the auction.'),(6,'Automobile Repair',500,'N','An automobile repair shop (also known as a garage) is a repair shop where automobiles are repaired by auto mechanics and technicians.'),(7,'Bail Bonds',1000,'H','Bail bonds act as a surety and pledge money or property as bail for the appearance of persons accused in court. Bail bond agents, on the other hand, are usually in the business to cater to criminal defendants, often securing their customers\' release in just a few hours.'),(8,'Bakery',500,'N','Bakers produce breads, pastries, and other baked goods. Goods are produced in large quantities for sale through establishments such as grocery stores. Generally, high volume production equipment is used in bakery. '),(9,'Barber',200,'H','Barber provides customers with barbering services, including cutting, trimming, shampooing, and styling hair. Give shaves and shape contour of hair line. May sell lotions, tonics, and other cosmetic supplies. Performs other tonsorial services, such as applying hairdressings or lotions, dyeing, shampooing, singeing, or styling hair, and massaging face, neck, or scalp. '),(10,'Beauty Salon',1000,'H','A beauty salon or beauty parlor (beauty parlour) (or sometimes beauty shop) is an establishment dealing with cosmetic treatments for men and women. Beauty salons provide more generalized services related to skin health, facial aesthetic, foot care, nail manicures, aromatherapy, even meditation, oxygen therapy, mud baths, and many other services.'),(11,'Blacksmith',2000,'H','A blacksmith is a metalsmith who creates objects from wrought iron or steel by forging the metal, using tools to hammer, bend, and cut (cf. whitesmith). Blacksmiths produce objects such as gates, grilles, railings, light fixtures, furniture, sculpture, tools, agricultural implements, decorative and religious items, cooking utensils and weapons.'),(12,'Bookstore',2000,'C','A bookstore is a store or a shop dedicated to selling books. There are all kinds of bookstores, namely, small premises having a few copies or whole buildings offering thousands of publications. Libraries may belong to a chain with many branches or have one unique selling point. These traders are booksellers.'),(13,'Bookkeeping',2000,'H','Bookkeeping is the recording of financial transactions, and is part of the process of accounting in business. It is the only word in the English language with three consecutive groups of a repeating letter. Transactions include purchases, sales, receipts, and payments by an individual person or an organization/corporation. '),(14,'Boot And Shoe Repair',200,'N','The boot and shoe repair constructs, decorates, or repairs precision leather products, such as luggage, shoes, and saddles, using machines and hand tools. Include workers who work with leather-like materials when process is similar. '),(15,'Building Contractor',10000,'H','Building contractor is responsible for the day-to-day oversight of a construction site, management of vendors and trades, and the communication of information to all involved parties throughout the course of a building project. The building contractor is employed by the client on the advice of the architect, engineer or the architectural technologist or the client him/herself if acting as the manager. A general contractor is responsible for the overall coordination of a project.'),(16,'Confectionery',1000,'H','A company or person that makes or sells confectionery is called confectioner. Confectionery also called sweets or candy. In general, though, confectionery is divided into two broad and somewhat overlapping categories, bakers\' confections and sugar confections. Bakers\' confectionery, includes principally sweet pastries, cakes, and similar baked goods. Sugar confectionery includes sweets, candied nuts, chocolates, chewing gum and bubblegum, sweetmeats, pastillage, and other confections that are made primarily of sugar. The confectionery industry also includes specialized training schools and extensive historical records.'),(17,'Car Wash',200,'N',' A car washer knows how to clean and maintain both the outside and the inside of cars. Makes sure that any loose dust on the car is dusted off before you begin and also ensure that all windows are closed. Dust loose dirt and wash cars off with water. Ensures that car windows and doors are properly secured before dusting and washing. Adjusts water pressure in hoses to ensure that no damage occurs. Mixes soap and water in appropriate quantities. Use cloth or sponge to soap cars and wash them down. Ensures that windscreens are not scratched during the soaping procedure.'),(18,'Carpentry',1000,'H','Carpenters work with many different types of tools. Carpenters construct and repair building frameworks and structures—such as stairways, doorframes, partitions, rafters, and bridge supports—made from wood and other materials. They also may install kitchen cabinets, siding, and drywall.'),(19,'Carpet Dealer',2000,'H','Carpet and Home Accessories are furniture items which are easy to replace and easy to move, and include almost any items that aren\'t strictly functionally necessary in the decorated space. These accessories include such items as curtains, sofa sets, cushions, tablecloths and decorative craft products, decorative wrought iron, and so on. These items are commonly used in indoor furnishings and layout and can include cloth items, paintings, and plants.'),(20,'Catering',1000,'H','Catering is the business of providing food service at a site such as a wedding location, hotel, public house (pub), or other location. Catering has evolved to become an artisanal affair. Caterers now create an experience that involves the senses. And a caterer is the one who arranges the delivery, preparation and presentation of food for clients. If you\'ve ever attended a bridal shower, fund raiser, rehearsal dinner, wedding reception or a bar mitzvah that had beautifully prepared and presented food, chances are that event was catered.'),(21,'Child Care',1000,'H','Child care is the caring for and supervision of a child or children, usually from age six weeks to age thirteen. Child care is the action or skill of looking after children by a day-care center, babysitter, or other providers. Child care is a broad topic covering a wide spectrum of contexts, activities, social and cultural conventions, and institutions.'),(22,'Chimney Cleaning',200,'N','Today, chimney sweeps maintains a thriving new industry in many parts of the world. The industry has expanded from the maintenance of wood-burning fireplace and appliance venting systems to include venting for many types of heating appliances, such as heating oil, natural gas, wood and pellet burning appliances, building furnaces and space heaters. The standard chimney brush is still used, along with more modern tools (such as vacuums, cameras and special chimney cleaning tools), although most sweeps are done from the bottom of the chimney, rather than the top, to prevent the dispersion of dust and debris.'),(23,'Clothes Cleaning',100,'N','Dry cleaning is any cleaning process for clothing and textiles using a chemical solvent other than water. It is used to clean fabrics that degrade in water, and delicate fabrics that cannot withstand the rough and tumble of a washing machine and clothes dryer. It can eliminate labor-intensive hand washing.'),(24,'Clothing Alteration',100,'N','A tailor is someone who sews, joins, reinforces, or finishes clothing or other items. They may create new pieces of clothing from patterns and designs or alter existing garments to fit customers better. They work for textile and apparel manufacturers, department stores, and dry cleaners.'),(25,'Clothing Store',2000,'H','For a clothing store, the objective is to display the merchandise in the best way possible to get sales. Customers must also feel that the store is attractive and comfortable to shop in. A store requires a long list of items that can help it reach its full potential, but only a few of these things are absolute essentials for a fledgling clothing store. While running the clothing store will require various types of furniture and equipments.'),(26,'Commodity Broker',10000,'C','A commodity broker is a firm or individual who executes orders to buy or sell commodity contracts on behalf of clients and charges them a commission. A firm or individual who trades for his own account is called a trader. Commodity contracts include futures, options, and similar financial derivatives. Clients who trade commodity contracts are either hedgers using the derivatives markets to manage risk, or speculators who are willing to assume that risk from hedgers in hopes of a profit.'),(27,'Computer Store',10000,'H','Computer repair is the process of identifying, troubleshooting and resolving problems and issues in a faulty computer. Computer repair is a broad field encompassing many tools, techniques and procedures used to repair computer hardware, software or network/Internet problems. Computer repair is also known as PC repair.'),(28,'Concrete Contractor',2000,'H','A Concrete Contractor is responsible for providing all of the material, labor, equipment (such as engineering vehicles and tools) and services necessary for the construction of the project. The Contractor hires specialized subcontractors to perform all or portions of the road building. The  Contractor is also responsible for the quality of all work performed by any and all subcontractors. '),(29,'Convenience Store',10000,'H','A convenience store is a small retail business that stocks a range of everyday items such as groceries, snack foods, confectionery, soft drinks, tobacco products, over-the-counter drugs, toiletries, newspapers, and magazines. In some jurisdictions, corner stores are licensed to sell alcohol, typically beer and wine. Such stores may also offer money order and wire transfer services. They differ from general stores and village shops in that they are not in a rural location and are used as a convenient supplement to larger stores.'),(30,'Cosmetic Seller',200,'H','A cosmetic seller is a cosmetic and skin care salesperson. The main job of a cosmetic seller is to meet sales goals while offering personalized customer service and maintaining long-lasting relationships with customers. There is not a formal education requirement for this job, but employers do look for industry knowledge and the ability to sell. Cosmetic sellers duties involve suggesting products, explaining how products work, demonstrating how to use products and performing makeovers.'),(31,'Dairy',5000,'H','A dairy is a business enterprise established for the harvesting or processing (or both) of animal milk – mostly from cows or goats, but also from buffaloes, sheep, horses, or camels – for human consumption. A dairy is typically located on a dedicated dairy farm or in a section of a multi-purpose farm (mixed farm) that is concerned with the harvesting of milk.'),(32,'Delivery Service',200,'N','Delivery of services are bound with principles, standards, policies and constraints which guide the design, development, deployment, operation and retirement of services delivered by a service provider with a view to offering a consistent service experience to a specific user community in a specific business context. The delivery of services are in the context with which a service provider\'s capabilities are arranged into services. '),(33,'Dog Training',100,'H','Dog training is the application of behavior analysis which uses the environmental events of antecedents and consequences to modify the behavior of a dog, either for it to assist in specific activities or undertake particular tasks, or for it to participate effectively in contemporary domestic life. Dog training can be socialisation to the domestic environment, basic obedience training or training for specialized activities including law enforcement, search and rescue, hunting, working with livestock, assistance to people with disabilities, entertainment, dog sports, detection and protecting people or property.'),(34,'Electric Contractor',3000,'H','An electrical contractor is a business person or firm that performs specialized construction work related to the design, installation, and maintenance of electrical systems.  An electrical contractor is different from an electrician; an electrician is an individual tradesman and an electrical contractor is a business person or company that employs electricians. Both usually hold licenses and insurances to properly and safely operate a business, protecting the employees and home owners/business owners from insurance liabilities. These requirements vary from state to state. Electricians may work for an electrical contractor, or directly for individuals or companies.'),(35,'Engineering',10000,'C','Industrial engineering is a branch of engineering which deals with the optimization of complex processes, systems or organizations. Industrial engineers work to eliminate waste of time, money, materials, man-hours, machine time, energy and other resources that do not generate value. According to the Institute of Industrial and Systems Engineers, they figure out how to do things better, they engineer processes and systems that improve quality and productivity. Industrial engineering is concerned with the development, improvement, and implementation of integrated systems of people, money, knowledge, information, equipment, energy, materials, analysis and synthesis, as well as the mathematical, physical and social sciences together with the principles and methods of engineering design to specify, predict, and evaluate the results to be obtained from such systems or processes.'),(36,'Excavating Contractor',3000,'H','In the world of construction, excavation contractors do much more than haul dirt around; their responsibilities include site preparation, grading, trenching and many other soil-related tasks. And, yes, they do operate some very large pieces of heavy equipment.'),(37,'Fabric Shop',1000,'H','A fabric shop retailing numerous styles and types of fabrics can be opened in a fixed storefront location. Fabric shops have traditionally been very profitable specialty retail operations as the markups applied to fabrics for retail sales can exceed 100 percent or more.'),(38,'Farm Equipment',10000,'H','Agricultural machinery is machinery used in farming or other agriculture. There are many types of such equipment, from hand tools and power tools to tractors and the countless kinds of farm implements that they tow or operate. Diverse arrays of equipment are used in both organic and nonorganic farming. Especially since the advent of mechanised agriculture, agricultural machinery is an indispensable part of how the world is fed.'),(39,'Financial Advisory Service',5000,'C','A financial adviser provides services to renders financial services to clients. A range of consulting services provided by financial advisors to businesses and high net worth individuals who require specialized advice on capital formation, cash flow and wealth management.'),(40,'Firewood',200,'N','Most firewood consumers purchase their wood from a firewood provider. With rising energy costs on the minds of many homeowners, firewood is increasingly becoming a sought-after fuel source for home heating. More than ever before, wood burning stoves are making their way into family rooms of rural, suburban and urban energy consumers.'),(41,'Floor Cleaning',100,'N','Floor cleaning is a specialized cleaning service. Some services, such as refinishing or removing deep seated dirt, should be out of your territory. Define what is inclusive in your cleaning services and can offer, cleaning and also waxing, and buffing floors under floor cleaning services.'),(42,'Florist',200,'H','A florist is someone who arranges flowers and other plant elements into a pleasing design. The arrangements are used primarily for celebratory events, but are also used for hotels, catered events, homes. Florists were once almost exclusively owners of small independent shops; however, with the recent invention of internet-based delivery services and all-in-one convenience markets, many are now employed by larger companies.'),(43,'Funeral Director',10000,'H','A funeral director, also known as a mortician or undertaker, is a professional involved in the business of funeral rites. These tasks often entail the embalming and burial or cremation of the dead, as well as the planning and arrangement of the actual funeral ceremony. Funeral directors may at times be asked to perform tasks such as dressing (in garments usually suitable for daily wear), casketing (placing the human body in the coffin), and cossetting (applying any sort of cosmetic or substance to the viewable areas of the corpse for the purpose of enhancing its appearance). A funeral director may work at a funeral home or be an independent employee.'),(44,'Furniture Dealer',2000,'H','People are always in need of furniture, be it beds, sofas, chairs, or tables. Learn about furniture, and where to go to acquire various pieces and brand name items, the buying and selling part is routine. Decide what kind of furniture you want to sell. New furniture requires going to trade shows and buying from wholesalers. Start off with second-hand or antique furniture as you learn the selling process, for the prices will not be as expensive buying used furniture compared to newer pieces.'),(45,'Furniture Repair',200,'H','Furniture repair is the work of taking a furniture part that has sustained some relatively minor damage and bringing it back to a condition where there is no longer any significant diminishment of either utility or beauty.'),(46,'Gas Station',20000,'H','A gas station is a facility that sells fuel and engine lubricants for motor vehicles. The most common fuels sold in the 2010s are gasoline (gasoline or gas in the U.S. and Canada, generally petrol elsewhere) and diesel fuel. A filling station that sells only electric energy is also known as a charging station, while a typical filling station can also be known as a fuelling station.'),(47,'General Contractor',10000,'H','A general contractor (main contractor, prime contractor) is responsible for the day-to-day oversight of a construction site, management of vendors and trades, and the communication of information to all involved parties throughout the course of a building project.'),(48,'General Store',10000,'H','A general store is a rural or small town store that carries a general line of merchandise. It carries a broad selection of merchandise, sometimes in a small space, where people from the town and surrounding rural areas come to purchase all their general goods. The store carries routine stock and obtains special orders from warehouses. It differs from a convenience store or corner shop in that it will be the main shop for the community rather than a convenient supplement.'),(49,'Gift Shop',1000,'H','A gift shop or Souvenir gift shop is a store primarily selling souvenirs relating to a particular topic or theme. The items sold often include coffee mugs, stuffed animals, t-shirts, postcards, handmade collections and other souvenirs. Gift shops are normally found in areas visited by many tourists. Hotels and Motels in Canada and the United States often feature a gift shop near their entrance. '),(50,'Graphic Design',1000,'H','Graphic design is a profession of visual communication and problem-solving using one or more of typography, photography and illustration. The field is considered a subset of visual communication and communication design, but sometimes the term \"graphic design\" is used synonymously. Graphic designers create and combine symbols, images and text to form visual representations of ideas and messages. Common uses of graphic design include corporate design (logos and branding), editorial design (magazines, newspapers and books), wayfinding or environmental design, advertising, web design, communication design, product packaging and signage.'),(51,'Grocery Store',10000,'H','A grocery store is a retail store that primarily sells food. A grocer is a bulk seller of food. Grocery stores often offer non-perishable food that is packaged in cans, bottles and boxes, with some also having fresh produce, butchers, delis, and bakeries.'),(52,'Gunsmith',5000,'H','A gunsmith is a person who repairs, modifies, designs, or builds guns. This occupation differs from an armorer. A gunsmith does factory level repairs, renovation (such as applying metal finishes), and makes modifications and alterations for special uses. Gunsmiths may also apply carvings, engravings and other decorative features to an otherwise finished gun. The environment in which all this takes place often varies depending on the specific locality, with some gun stores featuring one or a handful of individuals while others resemble large scale specialty shops.'),(53,'Hardware Store',10000,'H','Hardware stores sells household hardware for home improvement including: fasteners, building materials, hand tools, power tools, keys, locks, hinges, chains, plumbing supplies, electrical supplies, cleaning products, housewares, tools, utensils, paint, and lawn and garden products directly to consumers for use at home or for business. Many hardware stores have specialty departments unique to its region or its owner\'s interests. '),(54,'Hat Store',2000,'H','Hat store does the designing and manufacture of hats. A hat shop is a store that sells those goods. A hat store/ milliner or hatter designs, makes, trims, or sells hats. Hats are sold to women, men and children, though some definitions limit the term to women\'s hats.'),(55,'Heating Contractor',5000,'H','A heating contractor installs and repairs heaters, vents and air conditioners and their related equipment such as ductwork, thermostats, boilers, furnaces and heat pumps. Some heating contractors are also trained and licensed to perform such tasks as sealing ducts and performing energy audits. If a heater or air conditioner breaks or is in need of any sort of maintenance or repair, a heating contractor is the professional to call.'),(56,'Herb Seller',200,'H','Herbs are tremendously popular these days--from the smallest shop to the largest discount warehouse,  medicinal herbs, culinary herbs, and herbal teas, baths, candles and aromatherapy essences. Plant and raise your herbs, then sell them to wholesale or retail customers. One can start out small, growing your herbs in a large backyard or renting inexpensive land. One need to ground the wholesale herb business, what\'s popular, who\'s buying it for what purposes, which herbs are best abandoned to agribusiness and which new herbs are likely to be the \'in\' product in the next few years. '),(57,'Hotel',500000,'H','A hotel is an establishment that provides paid lodging on a short-term basis. Facilities provided may range from a modest-quality mattress in a small room to large suites with bigger, higher-quality beds, a dresser, a fridge and other kitchen facilities, upholstered chairs, a flatscreen television and en-suite bathrooms. Small, lower-priced hotels may offer only the most basic guest services and facilities. Larger, higher-priced hotels may provide additional guest facilities such as a swimming pool, business centre (with computers, printers and other office equipment), childcare, conference and event facilities, tennis or basketball courts, gymnasium, restaurants, day spa and social function services.'),(58,'House Cleaning',100,'N','Housecleaning is getting rid of mess, trash, dirt, and unclean actions so a household is better-looking. A reason people houseclean is to be able to see parts of the floor and furniture otherwise hidden by clutter. Other reasons are to keep from getting spider bites or breathing problems from dust. People may sweep and vacuum when housecleaning. They can also hang up clothes, do the laundry, and wash windows. Soaking up spilled red wine is another example of cleaning a mess in a house. Washing a sponge, squeezing it out and placing it on a dish rack to dry are a part of housecleaning.'),(59,'Insurance Broker',20000,'C','An insurance broker (also insurance agent) sells, solicits, or negotiates insurance for compensation. Insurance brokerage is largely associated with general and life insurance. General insurance brokering is carried out today by many types of authorized organisations including traditional high street brokers and telephone or web-based firms.'),(60,'Janitor Service',200,'H','A janitor (American English, Scottish English), janitress (female), custodian, cleaner or caretaker is a person who cleans and maintains buildings such as hospitals, schools and residential accommodation. Janitors\' primary responsibility is as a cleaner.  Cleaning is one of the most commonly outsourced services.'),(61,'Jeweller',10000,'H','A jeweler is an artisan who uses metals, gems and other materials to create adornments like bracelets, earrings, rings, and necklaces. They might also be called upon to repair, adjust, clean, and appraise pieces of jewelry.'),(62,'Martial Arts Instruction',3000,'H','Martial arts are codified systems and traditions of combat practices, which are practiced for a number of reasons: as self-defense, military and law enforcement applications, mental and spiritual development; as well as entertainment and the preservation of a nation\'s intangible cultural heritage. The martial arts instructor provides training to individivuals or group on the martial art.'),(63,'Kennel',10000,'H','A kennel is a structure or shelter for dogs or cats. Used in the plural, the kennels, the term means any building, collection of buildings or a property in which dogs or cats are housed, maintained, and (though not in all cases) bred. A kennel can be made out of various materials, the most popular being wood and canvas.'),(64,'Keymaker',300,'H','A person who makes a key or keys. Keys are not only something everyone needs, they are also high-margin items that take little time to make. If you think cutting keys is a business you would enjoy, it\'s vital that you understand how state laws may affect your business. If you want to make master keys or original keys, you may need a locksmith license. Creating only duplicate keys does not require licensing.'),(65,'Landscape Contractor',5000,'H','Landscape Contracting is a profession that involves the art and technology of landscape and garden project planning, construction and landscape management, and maintenance and gardening; for garden aesthetics, human enjoyment and safety, and ecosystem-plant community sustainability. Landscape Contracting Associations offer ongoing education, specialty skills certifications, and recognition of outstanding professional accomplishments.'),(66,'Laundry',2000,'H','Laundry is the washing of clothing and linens. Laundry processes are often done in a room reserved for that purpose; in an individual home this is referred to as a laundry room or utility room. An apartment building or student hall of residence may have a shared laundry facility such as a tvättstuga. A stand-alone business is referred to as a laundrette (laundromat). '),(67,'Lingerie Store',5000,'H','Lingerie stores are specially for women\'s undergarments, and may imply their being fashionable and alluring. Lingerie undergarments use flexible, stretchy, sheer, or decorative materials like Lycra, nylon (nylon tricot), polyester, satin, lace, silk and sheer fabric. Certain cotton or synthetic undergarments are also lingerie.'),(68,'Liquor Store',10000,'H','A liquor store is a retail shop that sells prepackaged alcoholic beverages — typically in bottles — intended to be consumed off the store\'s premises. Depending on region and local idiom, they may also be called bottle store, off licence, bottle shop, bottle-o, package store. '),(69,'Machine Shop',20000,'H','A machine shop is a room, building, or company where machining is done. In a machine shop, machinists use machine tools and cutting tools to make parts, usually of metal or plastic (but sometimes of other materials such as glass or wood). A machine shop can be a small business (such as a job shop) or a portion of a factory, whether a toolroom or a production area for manufacturing. The parts produced can be the end product of the factory, to be sold to customers in the machine industry, the car industry, the aircraft industry, or others. In other cases, companies in those fields have their own machine shops.'),(70,'Massage Therapy',200,'H','Massage therapy involves working and acting on the body with pressure – structured, unstructured, stationary, or moving – tension, motion, or vibration, done manually or with mechanical aids. Massage can be applied with the hands, fingers, elbows, knees, forearm, feet, or a massage device. Depending on the application and technique used, massage is used to promote relaxation and well-being, and is beneficial in treating sports injuries[3] and other problems affecting the musculature of the body such as postural misalignment and many painful conditions. In professional settings massage clients are treated while lying on a massage table, sitting in a massage chair, or lying on a mat on the floor, while in amateur settings a general purpose surface like a bed or floor is more common. Aquatic massage and bodywork is performed with recipients submersed or floating in a warm-water therapy pool.'),(71,'Mortgage Broker',20000,'C','A mortgage broker acts as an intermediary who brokers mortgage loans on behalf of individuals or businesses. Traditionally, banks and other lending institutions have sold their own products. As markets for mortgages have become more competitive, however, the role of the mortgage broker has become more popular. In many developed mortgage markets today, mortgage brokers are the largest sellers of mortgage products for lenders. Mortgage brokers exist to find a bank or a direct lender that will be willing to make specific loan an individual is seeking. Mortgage brokers in Canada are paid by the lender and do not charge fees for good credit applications.'),(72,'Motorcycle Repair',200,'H','A motorcycle mechanic is a small engine mechanic who specializes in maintaining and repairing traditional and nontraditional motorcycles, scooters, dirt bikes, and mopeds. A motorcycle mechanic\'s main duties are to service, inspect, repair and sometimes build motorcycle engines.'),(73,'Motorcycle Shop',10000,'H','Motorcycle accessories are features and accessories selected by a motorcycle owner to enhance safety, performance, or comfort, and may include anything from mobile electronics to sidecars and trailers. An accessory may be added at the factory by the original equipment manufacturer or purchased and installed by the owner post-sale as aftermarket goods.'),(74,'Movers',500,'H','A moving company, removalist or van line is a company that helps people and businesses move their goods from one place to another. It offers all inclusive services for relocations like packing, loading, moving, unloading, unpacking, arranging of items to be shifted. Additional services may include cleaning services for houses, offices or warehousing facilities.'),(75,'Music Store',5000,'H','A music store or musical instrument store is a retail business that sells musical instruments and related equipment and accessories. In United States and Canada, most music stores in the 2010s sell a range of electric instruments (e.g., electric guitars), instrument amplifiers (e.g., guitar amplifiers); electronic instruments (e.g., synthesizers); drum kits (including drums, cymbals and percussion instruments) and acoustic classical, concert band and jazz musical instruments such as saxophones, trumpets and violins. In addition, stores typically sell (and sometimes rent) the sound reinforcement system and PA system gear used in live concert performances and the sound recording equipment used to record music, such as microphones and digital recorders.'),(76,'Newspaper Vendor',200,'H','Newspaper vendors the distributors of newspapers to the general public. They were not employees of the newspapers but rather purchased the papers from the publishers and sold them as independent agents.'),(77,'Night Club',50000,'H','A nightclub (also known as a discothèque, disco, dance club or club) is an entertainment venue and bar which serves alcoholic beverages that usually operates late into the night. A nightclub is generally distinguished from regular bars, pubs or taverns by the inclusion of a stage for live music, one or more dance floor areas and a DJ booth, where a DJ plays recorded music and where coloured lights illuminate the dance area. Another distinction is that whereas many pubs and sports bars aim at a mass market, nightclubs typically aim at a niche market of music and dancing enthusiasts and clubgoers. '),(78,'Office Supplies',10000,'H','Office supplies are consumables and equipment regularly used in offices by businesses and other organizations, by individuals engaged in written communications, recordkeeping or bookkeeping, janitorial and cleaning, and for storage of supplies or data. The range of items classified as office supplies varies, and typically includes small, expendable, daily use items, consumable products, small machines, higher cost equipment such as computers, as well as office furniture.'),(79,'Oil Change And Lube',1000,'H','The oil change and lube business is convenience-driven. Oil change customers begrudgingly accept the fact that they need to have their vehicles serviced periodically, usually every three months or so. But what they won\'t accept are oil change businesses that fail to place a premium on fast turnaround and customer convenience. Most of today\'s oil change customers are also accustomed to buying additional services like total fluid replacements and tire rotations when they come in for an oil change. '),(80,'Paint Store',5000,'H','The Paint and Hardware stores (in a number of countries, \"shops\"), sometimes known as DIY stores, sell paints and household hardware for home improvement including: paints, fasteners, building materials, hand tools, power tools, keys, locks, hinges, chains, plumbing supplies, electrical supplies, cleaning products, housewares, tools, utensils and lawn and garden products directly to consumers for use at home or for business. '),(81,'Painting Contractor',5000,'H','Painting contractors are responsible for all preparation prior to painting. All scraping, sanding, wallpaper removal, caulking, drywall or wood repair, patching, stain removal, filling nail holes or any defects with plaster or putty, cleaning, taping, preparation and priming are considered to be done by the professional contracted painter. Painting contractor is a tradesman responsible for the painting and decorating of buildings, and is also known as a decorator or house painter. the painter was responsible for the mixing of the paint; keeping a ready supply of pigments, oils, thinners and driers. '),(82,'Party Suppliers',5000,'H','Party Supplies are an American record production and songwriting team, composed of Justin Nealis and Sean Mahon.'),(83,'Paving Contractor',5000,'H','A paving contractor is a company that constructs paved surfaces such as roads, sidewalks, concrete floors. They also work on larger projects, such as airport runways. These companies are hired by homeowners, businesses, and municipal agencies to pave new surfaces or repair existing ones. Many paving companies specialize in either residential or commercial work, though some may perform both types depending on the scope of the project and the equipment required.'),(84,'Pawnbroker',10000,'H','A pawnbroker is an individual or business (pawnshop or pawn shop) that offers secured loans to people, with items of personal property used as collateral. The items having been pawned to the broker are themselves called pledges or pawns, or simply the collateral. While many items can be pawned, pawnshops typically accept jewelry, musical instruments, home audio equipment, computers, video game systems, televisions, cameras, power tools and other relatively valuable items as collateral.'),(85,'Pest Control Service',5000,'H','Pest control service is about ways to repel pests and, if that doesn\'t work, to get rid of them or at least reduce the number. Pest control refers to the regulation or management of a species defined as a pest, and can be perceived to be detrimental to a person\'s health, the ecology or the economy. '),(86,'Pet Grooming',200,'N','Pet grooming refers to both the hygienic care and cleaning of the pet, as well as a process by which a pet\'s physical appearance is enhanced for showing or other types of competition. pet groomer (or simply \"groomer\") is a person who earns their living grooming pets.'),(87,'Pet Shop',10000,'H','A pet shop is a retail business which sells different kinds of animals to the public. A variety of animal supplies and pet accessories are also sold in pet shops. The products sold include: food, treats, toys, collars, leashes, cat litter, cages and aquariums. Some pet stores provide engraving services for pet tags, which have the owner’s contact information in case the pet gets lost.'),(88,'Pharmacy',50000,'C','Pharmacy is the science and technique of preparing and dispensing drugs.[citation needed] It is a health profession that links health sciences with chemical sciences and aims to ensure the safe and effective use of pharmaceutical drugs. The scope of pharmacy practice includes more traditional roles such as compounding and dispensing medications, and it also includes more modern services related to health care, including clinical services, reviewing medications for safety and efficacy, and providing drug information. '),(89,'Photographer',1000,'H','A professional photographer may be an employee, for example of a newspaper, or may contract to cover a particular planned event such as a wedding or graduation, or to illustrate an advertisement. Others, including paparazzi and fine art photographers, are freelancers, first making a picture and then offering it for sale or display.'),(90,'Physical Therapy',20000,'H','Physical therapy (PT), also known as physiotherapy, is a physical medicine and rehabilitation specialty that, by using mechanical force and movements, remediates impairments and promotes mobility, function, and quality of life through examination, diagnosis, prognosis, and physical intervention. It is performed by physical therapists (known as physiotherapists in many countries). In addition to clinical practice, other activities encompassed in the physical therapy profession include research, education, consultation, and administration. Physical therapy services may be provided alongside, or in conjunction with, other medical services.'),(91,'Piano Tuning And Repair',1000,'H','Piano tuning is the act of making minute adjustments to the tensions of the strings of an acoustic piano to properly align the intervals between their tones so that the instrument is in tune. The meaning of the term \'in tune\', in the context of piano tuning, is not simply a particular fixed set of pitches. Fine piano tuning requires an assessment of the vibration interaction among notes, which is different for every piano, thus in practice requiring slightly different pitches from any theoretical standard.'),(92,'Plumbing',2000,'H','Plumbing is any system that conveys fluids for a wide range of applications. Heating and cooling, waste removal, and potable water delivery are among the most common uses for plumbing; however, plumbing is not limited to these applications. Plumbing utilizes pipes, valves, plumbing fixtures, tanks, and other apparatuses to convey fluids. In the developed world plumbing infrastructure is critical for public health and sanitation.'),(93,'Psychic Medium',200,'H','A psychic is a person who claims to use extrasensory perception (ESP) to identify information hidden from the normal senses. The word \"psychic\" is also used as an adjective to describe such abilities. Psychics may be theatrical performers, such as stage magicians, who use techniques such as prestidigitation, cold reading, and hot reading to produce the appearance of such abilities. '),(94,'Real Estate Broker',20000,'H','A real estate broker or real estate salesperson (often called a real estate agent) is a person who acts as an intermediary between sellers and buyers of real estate/real property and attempts to match up sellers who wish to sell and buyers who wish to buy.'),(95,'Religious Goods',500,'H','A religious goods store or religious supplies shop is a store specializing in supplying materials used in the practice of respective religions.'),(96,'Restaurant',10000,'H','A restaurant is a business which prepares and serves food and drinks to customers in exchange for money. Meals are generally served and eaten on the premises, but many restaurants also offer take-out and food delivery services, and some only offer take-out and delivery. Restaurants vary greatly in appearance and offerings, including a wide variety of cuisines and service models ranging from inexpensive fast food restaurants and cafeterias to mid-priced family restaurants, to high-priced luxury establishments.'),(97,'Road Building Contractor',20000,'H','A Road Building Contractor is responsible for providing all of the material, labor, equipment (such as engineering vehicles and tools) and services necessary for the construction of the project. The Contractor hires specialized subcontractors to perform all or portions of the road building. The  Contractor is also responsible for the quality of all work performed by any and all subcontractors. Responsibilities may include applying for building permits, advising the person they are hired by, securing the property, providing temporary utilities on site, managing personnel on site, providing site surveying and engineering, disposing or recycling of construction waste, monitoring schedules and cash flows, and maintaining accurate records.'),(98,'Roofing Contractor',10000,'H','A Roofing Contractor is specialized in roof construction. Roofing Contractor concentrate on the application of materials that waterproof and/or weatherproof buildings, designed material—as a substrate for the roofing materials to be installed on, the rafters, beams, and trusses are the frame or skeleton for the roof to be built upon. Roofing Contractor must be able to work, have good motor skills and possess general carpentry skills.'),(99,'Salvage',10000,'H','As the owner of a salvage and resell business, you will work in the buying and selling of antique furniture and collectibles. A big part of your business will come from restoring damaged furniture for future resale.  Running a successful salvage and resell business will allow you work closely with interesting collectibles and help fellow antiquers build their own collections.'),(100,'Saw Sharpening And Repair',300,'H','Saw set is a term applied to various forms of a tool used in the tuning and sharpening of saw blades. The saw set is used to adjust the set, or distance the saw tooth is bent away from the saw blade. When the teeth of a saw are formed from the body, they are in line and the same thickness as the blade immediately behind them. A saw set makes the process of setting the teeth easier, more consistent or both.'),(101,'Scrap Metal',1000,'H','Scrap Metal consists of recyclable  metal  left over from product manufacturing and consumption, such as parts of vehicles, building supplies, and surplus materials. Unlike waste, scrap has monetary value, especially recovered metal recovered for recycling. Scrap Metal is often taken to a wrecking yard (also known as a scrapyard, junkyard, or breaker\'s yard), where it is processed for later melting into new products'),(102,'Septic Tank Cleaning',2000,'H','A septic tank cleaning is a small-scale sewage treatment system common in areas that lack connection to main sewage pipes provided by local governments or private corporations. Other components may include pumps, alarms, sand filters, and clarified liquid effluent disposal methods such as a septic drain field, ponds, natural stone fiber filter plants or peat moss beds. When a septic tank is emptied, the accumulated sludge (septage, also known as fecal sludge) is pumped out of the tank by a vacuum truck. '),(103,'Shoe And Boot Repair',200,'H','Shoemaking is the process of making footwear. Originally, shoes were made one at a time by hand. Traditional handicraft shoemaking has now been largely superseded in volume of shoes produced by industrial mass production of footwear, but not necessarily in quality, attention to detail, or craftsmanship. Shoemakers, also known as cordwainers, may produce a range of footwear items, including shoes, boots, sandals, clogs and moccasins. Such items are generally made of leather, wood, rubber, plastic, jute or other plant material, and often consist of multiple parts for better durability of the sole, stitched to a leather upper.'),(104,'Sporting Goods Shop',5000,'H','Sports equipment, called sporting goods where sold, is any object used for sport or exercise. As the sporting equipment industry improves, so does the athletes performance. This is due to the fact that the equipment is more efficient, lighter and stronger it forming a bio-mechanical system, interacting with the athlete. Since the massive adoption of wearable, new sport equipment tend to be electronics and connected to deliver data performances.'),(105,'Stable',10000,'H','A stable is a building in which livestock, especially horses, are kept. It most commonly means a building that is divided into separate stalls for individual animals. There are many different types of stables in use today; the American-style barn, for instance, is a large barn with a door at each end and individual stalls inside or free-standing stables with top and bottom-opening doors. The term \"stable\" is also used to describe a group of animals kept by one owner, regardless of housing or location.'),(106,'Stereo Shop',10000,'H','The stereo shop provides audio, video, home theater and home integration design specialists services which will work with you, your architect or interior designer to integrate the latest technologies that are easy to use. The stereo shop  provides equipment we sell, as well as the knowledge, experience hrough continuous training on the products.'),(107,'Stockbroker',50000,'C','A stockbroker is a regulated professional individual, usually associated with a brokerage firm or broker-dealer, who buys and sells stocks and other securities for both retail and institutional clients through a stock exchange or over the counter in return for a fee or commission. Stockbrokers are known by numerous professional designations, depending on the license they hold, the type of securities they sell, or the services they provide. '),(108,'Tanning Salon',10000,'H','Anning salons are facilities that offer people the opportunity of achieving an indoor tan. Tanning salons typically have several tanning beds, likened in appearance to a clam shell, in which people lie for a set period of time to gradually tan the skin. Usually, to achieve the desired shade of tan, people use tanning salons for a period of several weeks to several months. To maintain a tan, people must revisit tanning salons regularly. '),(109,'Tattooing',300,'H','A tattoo is an ink design inserted into the skin, commonly via a needle. In various forms, it has been used ornamentally and religiously by humans for thousands of years, with examples found on numerous preserved prehistoric specimens. Humans also use identification tattoos on domesticated animals, particularly livestock. Examples can be seen in most human cultures, and despite some social stigma, tattoos are becoming ubiquitous in the West, with an estimated 25% of Americans wearing at least one by the end of the 20th century.'),(110,'Tax Consultant',500,'C','Tax consultants are financial experts who assist clients with tax issues. This can include preparing tax returns, acting as a representative, or giving specialist advice. The ways in which a consultant operates, such as their fees and their licensing requirements, can vary greatly in different jurisdictions.  The most common role of tax consultants is to help people prepare and file their tax returns. This can be a valuable service, as failing to do so properly can leave a taxpayer liable to paying penalties. Incorrectly prepared tax returns can also mean a taxpayer misses out on a rebate they are due. This is particularly important in countries where the system generally involves paying estimates in advance and then recovering any excess as a rebate at the end of the financial year.'),(111,'Taxidermist',2000,'H','A taxidermist is a man or woman who stuffs and mounts deceased animals to be displayed in homes, museums, or other settings. He or she carefully removes and tans the hide of an animal, makes a plaster mold of the carcass, uses clay or foam to create a lifelike cast from the mold, and attaches the hide to the artificial figure. Most amateur taxidermists acquire skills by practice, video instruction, and seminars, while professionals who operate their own businesses often complete accredited taxidermy school programs to master the trade.'),(112,'Tile Contractor',5000,'H','Tile contractor has good many opportunities for flooring contractors to work alongside other home builders and construction professionals, particularly in areas where home renovations and building are booming. If working with your hands and a variety of wood and other products appeal to you, there are several ways to get started as a tile contractor.'),(113,'Tire Dealer',2000,'H','Tyre dealership is essentially Company Authorized Tyre Dealership that provide for various services some of them including Electronic Wheel Balancing, wheel Alignment, sale and replacement of tyres and so on. For all those that are not fond of automobiles but are keen to understand what this really means, here is a quick snapshot for it.'),(114,'Tobacco Shop',5000,'H','A tobacconist, also called a tobacco shop or smoke shop is a retailer of tobacco products in various forms and the related accoutrements, such as pipes, lighters, matches, pipe cleaners, pipe tampers. More specialized retailers may sell ashtrays, humidification devices, hygrometers, humidors, cigar cutters, and more. Books and magazines, especially ones related to tobacco are commonly offered. Items irrelevant to tobacco such as puzzles, games, figurines, hip flasks, canes or other walking sticks, and candy are sometimes sold.'),(115,'Tool Shop',5000,'H','Tool and die makers are a class of machinists in the manufacturing industries who make jigs, fixtures, dies, molds, machine tools, cutting tools, gauges, and other tools used in manufacturing processes. Depending on which area of concentration a particular person works in, he or she may be called by variations on the name, including tool maker (toolmaker), die maker (diemaker), mold maker (moldmaker), tool fitter (toolfitter), etc.'),(116,'Trampoline Equipment',5000,'H','A trampoline is a device consisting of a piece of taut, strong fabric stretched over a steel frame using many coiled springs. People bounce on trampolines for recreational and competitive purposes. The fabric that users bounce on (commonly known as the \"bounce mat\" or \"trampoline bed\") is not elastic itself; the elasticity is provided by the springs that connect it to the frame, which store potential energy.'),(117,'Trash Hauling',300,'H','Trash Hauling (Waste collection) is a part of the process of waste management. It is the transfer of solid waste from the point of use and disposal to the point of treatment or landfill. Waste collection also includes the curbside collection of recyclable materials that technically are not waste, as part of a municipal landfill diversion program.'),(118,'Tree Service',400,'H','Tree service are sophisticated methods for scaling trees in order to remove part or all of plants that have been determined to be unnecessary. Using tools such as pruning hooks, wood chippers, stump grinders, hacksaws, and chainsaws, they work carefully, using all technologies available to accomplish their goals in a safe and professional manner.'),(119,'Trucking',10000,'H','The trucking industry as a whole is extremely competitive, and the rising cost of fuel, maintenance, and insurance has resulted in drivers having to work extremely long hours to generate any profit beyond a working wage. To start a trucking business, secure transportation accounts, and hire subcontract drivers with their own trucks and equipment to service the transportation accounts. Otherwise, trucks  purchase or lease a truck and work as an independent trucker, servicing your own accounts or subcontracting for a transportation firm.'),(120,'Uniform Supply',5000,'H','Nowadays, uniforms are becoming required in many areas, from schools to the workplace. This means there is an increasing need to purchase different types of uniforms. Start planning  whether to have your own uniform store, should you be clear right at the beginning whether have intend to design or only supply uniforms. Depending on this decision, one can now determine your startup cost, personnel to hire and marketing activities. Choose which segment of the market you want to focus on in the beginning. It would help you look at both work uniforms and school uniforms store.'),(121,'Upholsterer',2000,'H','This is the type of upholstery work offered to businesses. Examples would be restaurant seating consisting of booth seats, dining room chairs, bar stools, etc. Also churches, including but not limited to pews and chairs for the congregation, hospitals and clinics consisting of medical tables, chiropractic tables, dental chairs, etc. Also common to this type of upholstery would be lobby and waiting-area seating. Upholstered walls are found in some retail premises.'),(122,'Video Arcade',10000,'H','Video arcade is a venue where people play arcade games such as video games, pinball machines, electro-mechanical games, redemption games, merchandisers (such as claw cranes), or coin-operated billiards or air hockey tables. In some countries, some types of arcades are also legally permitted to provide gambling machines such as slot machines or pachinko machines. Games are usually housed in cabinets. The term used for ancestors of these venues in the beginning of 20th century was penny arcades.'),(123,'Warehousing',100000,'H','A warehouse is a commercial building for storage of goods. Warehouses are used by manufacturers, importers, exporters, wholesalers, transport businesses, customs, etc. They are usually large plain buildings in industrial areas of cities, towns and villages. They usually have loading docks to load and unload goods from trucks. Sometimes warehouses are designed for the loading and unloading of goods directly from railways, airports, or seaports.'),(124,'Water Supply Systems',10000,'H','A water supply system or water supply network is a system of engineered hydrologic and hydraulic components which provide water supply. A sustainable urban water supply network covers all the activities related to provision of potable water. Sustainable development is of increasing importance for the water supply to urban and rural areas.'),(125,'Welding',1000,'H','Welding is a fabrication or sculptural process that joins materials, usually metals or thermoplastics, by causing fusion, which is distinct from lower temperature metal-joining techniques such as brazing and soldering, which do not melt the base metal. In addition to melting the base metal, a filler material is typically added to the joint to form a pool of molten material (the weld pool) that cools to form a joint that is usually stronger than the base material. Pressure may also be used in conjunction with heat, or by itself, to produce a weld.'),(126,'Window Cleaning',100,'H','Window cleaning is the cleaning of architectural glass used for structural, lighting, or decorative purposes. It can be done manually, using a variety of tools for cleaning and access. Technology is also employed and increasingly, automation. Commercial work is contracted variously from in-person transactions for cash or barter, to formal tender processes. Regulations, licensing, technique, equipment and compensation vary nationally and regionally.'),(127,'Window Replacement And Repair',3000,'H','The target market for a window and door repair service is owners of older homes that have wooden sash doors and windows. The reason to target these homes for this type of business is due to the fact that old wooden windows and doors require yearly maintenance, such as new putty, paint, and removal and installation of storm windows. The demand for this type of repair service will always be strong, as many of these homeowners would not consider replacing the windows and doors because the heritage value the wooden doors and windows add to the home\'s appearance.'),(128,'Wrecking Service',20000,'H','Wrecking SErvices include mainly any vehicle built and equipped for the purpose of towing, lifting, pulling or otherwise transferring motor vehicles from place to place including, but not limited to, those vehicles that are commonly referred to as \"roll-back\" or \"flatbed\" type tow trucks. Each wrecker service firm shall maintain a record of each vehicle towed, including the license plate number of the vehicle, the vehicle identification number, the date and time it was towed, the location it was towed from, and the name of the person or business at whose request the vehicle was towed. '),(129,'Zipper Repair',100,'H','Zipper repair is a replacement zipper slider that you can install without tools or sewing. The zipper repair replaces damaged or missing zipper sliders. Repairs broken zippers that separate or come undone. One can find a range of zipper sizes, which works on nylon coils as well as plastic and metal teeth.'),(130,'No_business',0,'N','No businenss is considered. ');
