INSERT INTO `jobs` VALUES (1,'SENIOR_GOVERNMENT_OFFICIAL','Senior Government Official','Senior Government Official provides information, advice and guidance to public servants regarding the organization\'s internal disclosure procedures including the making of disclosures, the conduct of investigations into disclosures, and the handling of disclosures made to supervisors. Receives and records disclosures and review them to establish whether there are sufficient grounds for further action under laid norms.',75,NULL,NULL,35,0,5,10,60,0,0,5,0,0,0,0,'G','U','M',0,1,0,150000,0,0,1),(2,'COMMUNITY_LEADER','Community Leader','Community leader instructs and supervises work projects to perform required services. Supervises hands on work activities and facilitates team members.Provides instruction and feedback, addresses behavior and builds pro-social skills.Writes reports and evaluates performance for the sub ordinates. Tracks attendance in database and communicates regularly with the community. ',75,NULL,NULL,32,0,10,10,50,0,0,0,0,0,10,0,'C','B','M',0,0,1,50000,0,0,1),(3,'SENIOR_NGO_OFFICIAL','Senior Ngo Official','Senior NGO Official takes the lead to develop, implement and evaluate assigned programmes/projects, etc.; directs subordinates in programme/project development, implementation, monitoring and assessment; directs review of relevant documents and reports; identifies priorities, problems and issues to be addressed and proposes corrective actions; liaises with relevant parties; identifies and initiates follow-up actions.',75,NULL,NULL,45,0,5,20,60,0,0,5,0,0,0,0,'G','U','B',0,1,0,70000,0,0,1),(4,'NGO_OFFICIAL','Ngo Official','NGO Official works closely with the field teams, as well as development program team for strategy and implement efforts to accomplish impact  Engage with prospective and current resources to assess the quality and alignment of their ideas and proposed work in relation to the organistions goals evaluate organizational strengths and weaknesses help institution develop proposal ideas, goals, and indicators of success and learn about progress and implementation challenges; and draw lessons from the outcomes.',75,'SENIOR_NGO_OFFICIAL',3,35,0,10,5,55,0,0,5,0,0,0,0,'G','U','B',0,1,0,40000,0,0,1),(5,'COMPANY_PRESIDENT','Company President','Company president provides programmatic leadership and input for all strategic plan implementation processes with the CEO, the SME, and staff; Provide effective and inspiring leadership to ensure alignment of methodologies. Partners with the CEO and other members of SME to ensure alignment of organizational priorities. Coordinates closely with various departments to ensure that development and implementation are guided by vision and strategy.',75,NULL,NULL,30,0,10,10,60,0,0,0,0,0,0,0,'C','U','M',1,1,1,250000,0,0,1),(6,'PRODUCTION_DEPARTMENT_MANAGER','Production Department Manager','Production department manager leads and develops a multi-functional team (manufacturing, assembly, planning, shipping, receiving and quality) to establish, communicate and achieve operational goals and production standards in quality, production volume, inventory, cost, delivery, plant security, compliance & Environmental Health and Safety (EHS). Responsible for developing and meeting all key manufacturing metrics, such as Variable Cost of Production (VCP), Product Quality performance, Cost of Quality, On Time delivery & EHS metrics. Establishes daily and weekly communication routines in the factory to drive awareness and ownership.',70,'GENERAL_MANAGER',8,30,0,20,5,60,5,0,5,0,0,0,0,'C','U','M',1,1,1,170000,0,0,1),(7,'DEPARTMENT_MANAGER','Department Manager','Department Manager is responsible for overseeing the daily activities of hourly associates on the Sales Floor, Front End, Freight, Delivery or Stocking departments. Responsible for training, mentoring, and coaching employees. Also manages associate performance and ensures adequate department coverage through influencing scheduling. Conducts activities appropriate for specific department .',70,'GENERAL_MANAGER',8,30,0,40,5,50,0,0,5,0,0,0,0,'C','U','B',1,1,1,120000,0,0,1),(8,'GENERAL_MANAGER','General Manager','General manager provide leadership to multi-functional departments in order to deliver exceptional service and achieve overall profit goals. Builds an organizational climate which promotes collaboration and commitment by providing learning and growth opportunities for employees while consistently raising performance expectations. Actively engage and maintain/enhance client relationships to ensure overall satisfaction, account retention and improved service penetration.',70,'COMPANY_PRESIDENT',5,34,0,15,10,60,0,0,5,0,0,0,0,'C','U','B',1,1,1,130000,0,0,1),(9,'SENIOR_SCIENTIST','Senior Scientist','Senior scientist conducts environmental site investigations, assessments and surveys to sample, measure and analyze air, water, material, and soil.  Identify, evaluate and recommend risk and remediation strategies/designs to ensure compliance with federal, state and local regulations.  Prepare applicable permit applications, risk assessments and technical documents including proposals, reports and regulatory agency correspondence.  Design systems and environmental protection plans. ',70,'GENERAL_MANAGER',8,32,0,50,10,60,0,0,5,0,0,0,0,'G','B','B',0,1,0,100000,0,0,1),(10,'SCIENTIST','Scientist','Scientist develops and executes laboratory work plans/schedules independently, using customer milestones and Division/site performance standards and metrics.  Sample types include in-process, release or stability.  Perform method validation, perform method development activities under senior\'s directions.',70,'SENIOR_SCIENTIST',9,20,0,70,0,60,0,0,5,0,0,0,0,'G','B','B',0,1,0,80000,0,0,1),(11,'MATHEMATICIAN','Mathematician','Mathematician implements advanced numerical, data assimilation, optimization and computational intelligence methods to build, maintain, and improve on processes. Identify what data is available and relevant, including internal and external data sources, leveraging new data collection processes.',70,'SENIOR_SCIENTIST',9,20,0,60,0,60,0,0,5,0,0,0,0,'G','U','B',0,1,1,100000,0,0,1),(12,'SOFTWARE_DEPARTMENT_MANAGER','Software Department Manager','Software project manager technically manges the team, interacts with various stakeholders primarily being other Engineering Project Managers and Third party vendors. Must people-manage the team and strive hard to keep them motivated.  Must ensure on-time, within budget and right quality delivery of the projects/products allocated. Awareness and experience in practices like defensive programming, continuous integration builds, code coverage, automated unit tests. ',65,'GENERAL_MANAGER',8,25,0,80,4,60,0,0,5,0,0,0,0,'C','B','B',0,1,1,100000,0,0,1),(13,'COMPUTER_PROGRAMMER','Computer Programmer','Software engineer determines operational feasibility by evaluating analysis, problem definition, requirements, solution development, and proposed solutions. Documents and demonstrates solutions by developing documentation, flowcharts, layouts, diagrams, charts, code comments and clear code.',65,'SOFTWARE_DEPARTMENT_MANAGER',12,20,0,30,0,60,0,0,5,0,0,0,0,'C','B','B',0,1,1,80000,0,0,1),(14,'ENGINEERING_DEPARTMENT_MANAGER','Engineering Department Manager','Engineering Department Manager provides technical support to the business development, estimating and onsite engineering teams, Responsible for overseeing all aspects of build design, from contract award to handover, Lead the preparation of technical and contract documentation for issue and analysis of returned tenders, Assisting projects with value engineering and financial control of contracts during construction stage; Develop planning and prioritise processes to ensure that multi-disciplinary resource is well aligned to maximise delivery of projects',70,'GENERAL_MANAGER',8,30,0,80,6,60,0,0,5,0,0,0,0,'C','B','B',0,1,1,120000,0,0,1),(15,'ENGINEER','Engineer','A professional engineer is competent by virtue of his/her fundamental education and training to apply the scientific method and outlook to the analysis and solution of engineering problems. He/she is able to assume personal responsibility for the development and application of engineering science and knowledge, notably in research, design, construction, manufacturing, superintending, managing and in the education of the engineer. ',70,'ENGINEERING_DEPARTMENT_MANAGER',14,20,0,80,0,60,0,0,5,0,0,0,0,'C','B','M',0,1,1,75000,0,0,1),(16,'BIOLOGIST','Biologist','Biologist collects and analyzes biological data about relationships among and between organisms and their environment. Study aquatic plants and animals and environmental conditions affecting them, such as radioactivity or pollution. Communicate test results to state and federal representatives and general public. Identify, classify, and study structure, behavior, ecology, physiology, nutrition, culture, and distribution of plant and animal species.',70,'SENIOR_SCIENTIST',9,20,0,60,0,50,0,0,5,0,0,0,0,'G','B','B',1,1,1,50000,0,0,1),(17,'DOCTOR','Doctor','Doctor, general practitioner responds medical/health problems presented by patients including history taking, diagnosis, investigation, treatment and referral as appropriate; Maintains confidentiality and impartiality; Commission healthcare by liaising with medical professionals in the community and hospitals; Promot health education in conjunction with other health professionals; Works as part of a team alongside other healthcare professionals, including community health doctors.',70,NULL,NULL,24,0,100,0,50,0,0,5,0,0,0,0,'G','B','B',0,1,0,210000,0,0,1),(18,'HEAD_NURSE','Head Nurse','Head nurse plans the staffing budget and recruitment. Ensures that nursing care meets regulatory standards. Review and approve nursing policies and procedures. Evaluate nursing staff performance. Collaborate with nursing staff, upper management and external agencies in the coordination of patient care. Train nursing management staff and coordinate educational programs for patients and their families. Facilitate meetings with medical staff from other departments. Ensure that nursing care medical services are meeting patient needs',70,'DEPARTMENT_MANAGER',7,30,0,100,8,50,0,0,5,0,0,0,0,'G','B','F',0,1,0,100000,0,0,1),(19,'NURSE','Nurse','nurse assesses and planns nursing care requirements; Provides pre- and post-operation care. Monitors and administers medication and intravenous infusions. Takes patient samples, pulses, temperatures and blood pressures. Writs records. Supervises junior staff. Organises workloads. Provides emotional support to patients and relatives. Tutors student nurses.',70,'HEAD_NURSE',18,20,0,100,0,40,0,0,5,0,0,0,0,'G','B','F',0,1,0,50000,0,0,1),(20,'COLLEGE_PRESIDENT','College President','College president plans and directs all policies, objectives, and initiatives for a single campus or institution. Demonstrates expertise in a variety of the field\'s concepts, practices, and procedures. Relies on extensive experience and judgment to plan and accomplish goals. Performs a variety of tasks. Leads and directs the work of others. A wide degree of creativity and latitude is expected. May preside over board of directors or trustees.',70,NULL,NULL,40,0,40,15,90,0,0,5,0,0,0,0,'G','U','B',0,1,0,430000,0,0,1),(21,'COLLEGE_HEAD_OF_DEPARTMENT','College Head Of Department','College head of department actively assists the College Principal in ensuring the good professional practice, standards, and quality of teaching and learning of subject/s through proper dialogue with the class teachers and, under the direction of the relative Education Officer, promotes a healthy process of reciprocal informal observation of class teaching practices; Advises and contributs in curriculum development at school and system level under the direction and guidance of the respective Education Officer; Co-ordinates the teaching and learning of the subject/s for which one is responsible; Sets examination papers, co-ordinates marking schemes and moderes examinations and assessment processes.',70,'COLLEGE_PRESIDENT',20,30,0,60,6,90,0,0,5,0,0,0,0,'G','U','B',0,1,0,90000,0,0,1),(22,'COLLEGE_PROFESSOR','College Professor','College professor teaches courses in their subject area. Works with students who are studying for a degree or a certificate or certification or are taking classes to improve their knowledge or career skills. Develops an instructional plan (known as a course outline or syllabus) for the course(s) they teach and ensure that it meets college and department standards. Plans lessons and assignments. Works with colleagues to develop or modify the curriculum for a degree or certificate program involving a series of courses. Assesses students progress by grading papers, tests, and other work.',70,'COLLEGE_HEAD_OF_DEPARTMENT',21,24,0,20,0,90,0,0,0,0,0,0,0,'G','U','B',0,1,0,60000,0,0,1),(23,'SCHOOL_PRINCIPAL','School Principal','School principal serves as the chief administrator of a school in developing and implementing policies, programs, curriculum activities, and budgets in a manner that promotes the educational development of each student and the professional development of each staff member.  conceptualizes the broad goals of the school and plans accordingly to ensure that procedures and schedules are implemented to carry out the total school program. ',70,NULL,NULL,30,0,40,10,50,0,0,5,0,0,0,0,'G','B','B',0,1,0,80000,0,0,1),(24,'SCHOOL_ADMINISTRATOR','School Administrator','School administrator oversees all the administrative duties at schools from preschool through post-graduate levels. An educational administrator tries to keep programs running smoothly and provides leadership on both ordinary days and in times of crisis. Budgets, logistics, schedules, disciplinary actions, evaluations and public relations fall under the purview of educational administrators. They also have a hand in matters like planning events and implementing curriculum. Ensures that their school follows regulations set by local, state and federal authorities. ',70,'SCHOOL_PRINCIPAL',23,26,0,70,4,40,0,0,5,0,0,0,0,'C','B','B',0,1,0,70000,0,0,1),(25,'SECONDARY_SCHOOL_TEACHER','Secondary School Teacher','Secondary school teacher prepares and delivers lessons to a range of classes of different ages and abilities mark work, give appropriate feedback and maintain records of pupils\' progress and development. Researches new topic areas, maintaining up-to-date subject knowledge, and devise and write new curriculum materials. Selects and use a range of different learning resources and equipment, including podcasts and interactive whiteboards. Prepares pupils for qualifications and external examinations. ',70,'SCHOOL_ADMINISTRATOR',24,22,0,80,0,40,0,0,5,0,0,0,0,'C','B','B',0,1,0,60000,0,0,1),(26,'PRIMARY_SCHOOL_TEACHER','Primary School Teacher','Primary school teacher develops childrens interests, abilities and coordination using a variety of creative activities including art, sport and music. Maintains productive working habits and discipline in the classroom. Supervises students throughout the day, both in the classroom and outside during breaks. Attends staff meetings and training and development sessions. Assesses and evaluating students educational progress and abilities. Discusses students progress with parents and guardians, administrators and other professionals as necessary.',70,'SCHOOL_ADMINISTRATOR',24,22,0,80,0,40,0,0,5,0,0,0,0,'C','B','B',0,1,0,35000,0,0,1),(27,'SPECIAL_EDUCATION_TEACHER','Special Education Teacher','Special education teacher assesses students skills to determine their needs and to develop teaching plans. Adapts lessons to meet the needs of students. Develops Individualized Education Programs (IEPs) for each student. Plans, organizes, and assigns activities that are specific to each students abilities. Teaches and mentors students as a class, in small groups, and one-on-one. Discusses students progress with parents, teachers, counselors, and administrators.',65,'SCHOOL_ADMINISTRATOR',24,22,0,80,0,40,0,0,5,0,0,0,0,'C','B','B',0,1,0,40000,0,0,1),(28,'SCHOOL_COUNSELLOR','School Counsellor','School counsellor listens to students concerns about academic, emotional or social problems. Helps students process their problems and plan goals and action. Mediates conflict between students and teachers. Improves parent/teacher relationships. Assists with college applications, jobs and scholarships. Facilitates drug and alcohol prevention programs. Organizes peer counseling programs. Refers students to psychologists and other mental health resources. Works on academic boards to improve learning conditions.',70,'SCHOOL_ADMINISTRATOR',24,24,0,50,0,45,0,0,5,0,0,0,0,'G','B','B',0,1,0,50000,0,0,1),(29,'MARKETING_DIRECTOR','Marketing Director','Marketing director contributes to marketing effectiveness by identifying short-term and long-range issues that must be addressed; providing information and commentary pertinent to deliberations; recommending options and courses of action; implementing directives. Obtains market share by developing marketing plans and programs for each product; directing promotional support. Maintains relations with customers by organizing and developing specific customer- relations programs; determining company presence at conventions, annual meetings, trade associations, and seminars.',70,'GENERAL_MANAGER',8,18,0,40,8,35,0,0,5,0,0,0,0,'C','B','B',0,1,1,150000,0,0,1),(30,'JUDGE','Judge','A judge performs a variety of tasks inside and outside the courtroom. In the courtroom, a judge hears allegations of the prosecuting and defending parties, listens to witness testimony, rules on the admissibility of evidence, informs defendants of their rights, instructs the jury, questions witnesses and rules on motions presented by counsel. In criminal court, judges determine the guilt or innocence of criminal defendants and impose sentences on defendants found guilty. In civil cases, a judge may determine liability or damages.',75,NULL,NULL,30,0,60,10,65,0,0,5,0,0,0,0,'G','U','B',0,1,0,210000,0,0,1),(31,'LAWYER','Lawyer','Lawyer studies constitution, statutes, decisions, regulations, and ordinances of quasi-judicial bodies to determine ramifications for cases. Prepares legal briefs and opinions, and file appeals in state and federal courts of appeal. Represents clients in court or before government agencies. Presents evidence to defend clients or prosecute defendants in criminal or civil litigation. Selects jurors, argue motions, meet with judges, and question witnesses during the course of a trial.',70,'JUDGE',31,23,0,90,0,55,0,0,5,0,0,0,0,'G','B','B',0,1,0,120000,0,0,1),(32,'LIBRARIAN','Librarian','Librarian develops and manages collections of books and journals (both paper and electronic), as well as websites;Establishes and maintains effective working relationships with academic staff and students; Contributes academic course development and liaising with academic departments;  Coordinates and delivering information and digital literacy sessions to staff and students; Creats, updates and manages electronic and printed information resources.',70,NULL,NULL,22,0,50,0,45,0,0,5,0,0,0,0,'C','U','B',0,1,0,60000,0,0,1),(33,'SOCIAL_SCIENTIST','Social Scientist','Social scientist directs and participates in qualitative and quantitative data collection methodologies to include direct observation, visual ethnography, key leader engagement, participant observation, depth interviewing, group or focus group interviewing, surveying, secondary source research, and mixed method approaches. Observe links between society and human behavior. Conducts field studies of cultures. Designs and leads research projects, including both long and short-term projects.',75,'SENIOR_SCIENTIST',9,22,0,50,0,60,0,0,5,0,0,0,0,'G','U','B',0,1,0,60000,0,0,1),(34,'WRITER','Writer','Writer / author chooses subject matter that interests readers. Writes fiction or nonfiction through scripts, novels, and biographies. Conducts research to obtain factual information and authentic detail. Writes advertising copy for use by newspapers, magazines, broadcasts, and the Internet Presents drafts to editors and clients for feedback. Works with editors and clients to shape the material so it can be published',90,NULL,NULL,17,1,100,0,60,30,0,0,0,0,0,0,'C','B','B',0,1,0,50000,0,0,1),(35,'ARTIST','Artist','Artist (fine art) generates ideas, idea development, sketching, making models; Creates  or developing a piece of work in response to a brief or commission; Meets deadlines; Works in a studio or off-site and adhering to health and safety procedures; Sourcing materials and developing relationships with suppliers; Researching, visiting locations, interviewing people, using libraries and the internet.',90,NULL,NULL,15,1,100,0,55,80,0,0,0,0,0,0,'N','B','B',0,1,0,50000,0,0,1),(36,'MUSICIAN','Musician','Musician performs at concerts, festivals, theatres and other music venues; Participates in recording sessions; Looks after your instrument and/or voice; Sets up/tune your instrument and other equipment, and arrange for its transportation, if it is large; Composes new songs and music; Handles the administration of business activities such as promotion, handling accounts, negotiating fees and organising distribution of your recordings both offline and online; Seek out and liaise with new venues in which to perform.',90,NULL,NULL,12,1,100,0,50,30,80,0,0,0,10,0,'N','B','B',0,1,0,50000,0,0,1),(37,'PROFESSIONAL_ATHLETE','Professional Athlete','Professional athlete becomes member of professional athletic team. Practices with team members on a regular basis and competes in chosen sport (i.e., football, baseball, gymnastics, swimming, etc.). Has knowledge of sport\'s practices, policies, rules and regulations. May act as a spokesperson for team and/or sport. Competing in sporting competitions.',36,NULL,NULL,16,0,5,0,30,0,0,85,0,40,60,0,'N','B','M',0,1,0,60000,0,0,1),(38,'CHEMISTRY_LAB_TECHNICIAN','Chemistry Lab Technician','Chemistry lab technician monitors product quality to ensure compliance with specifications and standards. Conducts chemical or physical lab tests to help scientists analyze solids, liquids or gases. Compiles and interprets results of tests and analyses. Provides and maintains a safe work environment. Sets up and conducts experiments. Orders and maintains inventory materials. Prepars chemical solutions for products and procedures. Maintains, cleans or sterilizes lab instruments and equipment. Provides technical support or assistance to chemists or engineers.',70,'DEPARTMENT_MANAGER',7,20,0,80,0,50,0,0,5,0,0,0,0,'C','U','B',0,1,0,40000,0,0,1),(39,'COMPUTER_TECHNICIAN','Computer Technician','Computer technician installs hardware, software and device drivers on standalone computers. Installs and configure computer networks including LAN and WAN. Manages network configurations to ensure that all computers on a network can communicate effectively. Test computers peripherals, hardware and software to ensure that they are working appropriately. Upgrade software, patches and operating systems on a continuous basis. Install and configure monitors, keyboards and printers. Troubleshoot hardware and software problems.',70,'DEPARTMENT_MANAGER',7,18,0,40,0,50,0,0,5,0,0,0,0,'V','U','B',0,1,1,35000,0,0,1),(40,'ELECTRONIC_EQUIPMENT_OPERATOR','Electronic Equipment Operator','Communication equipment operator supports businesses by operating switchboards and connecting callers to the appropriate person. May operate PBX, or private branch exchange switchboards, or voiceover Internet protocol switchboards. Makes and relays messages/ important information, handles emergency calls, assists customers in making telephone calls, research and advise on rates, assists callers with other questions, helps callers make long-distance or local calls, provides customers with area codes, telephone numbers and other information.',70,'DEPARTMENT_MANAGER',7,20,0,30,0,60,0,0,5,0,0,0,0,'H','U','B',0,1,1,35000,0,0,1),(41,'AIR_TRAFFIC_CONTROLLER','Air Traffic Controller','The air traffic controller coordinates the arrival and departure of airplanes. Issues landing and takeoff instructions to pilots. Monitors and direct the movement of aircraft, using radar equipment. Authorizes flight path changes. Provides weather updates to pilots. Alerts airport response staff in the event of an aircraft emergency. Manages communications by transferring control of departing flights to traffic control centers and accepting control of arriving flights. Provides information to pilots, such as weather updates, runway closures, and other critical information. Alerts airport response staff, in the event of an aircraft emergency.',60,'DEPARTMENT_MANAGER',7,22,0,20,0,70,0,0,30,0,0,20,0,'C','U','B',0,1,1,120000,0,0,1),(42,'SAFETY_INSPECTOR','Safety Inspector','Safety inspector inspects equipment, tools, and working conditions to ensure safety of workers engaged in construction and maintenance of overhead and underground power lines: Inspects safety belts, ladders, ropes, rubber goods, and tools and replaces those not meeting safety requirements. Observes crews at work and reports laxity in safety precautions, such as failure to use goggles, rubber gloves, and other safety devices. Examines conditions of ditches and tunnels and recommends use of braces to prevent cave-ins endangering workers. Investigates accidents to determine causes and devises preventive measures. May instructs workers in use of safety equipment and safe work methods.',65,'DEPARTMENT_MANAGER',7,20,0,50,0,40,0,0,20,0,0,20,0,'H','U','B',0,1,1,40000,0,0,1),(43,'LAB_TECHNICIAN','Lab Technician','Scientific lab technician performs laboratory tests in order to produce reliable and precise data to support scientific investigations. Carrys out routine tasks accurately and following strict methodologies to carry out analyses. Prepares specimens and samples. Constructs, maintains and operates standard laboratory equipment, for example centrifuges, titrators, pipetting machines and pH meters. Ensures the laboratory is well-stocked and resourced. Records and sometimes interprets results to present to senior colleagues. Keeps up to date with technical developments, especially those which can save time and improve reliability. Conducts searches on identified topics relevant to the research.',70,'DEPARTMENT_MANAGER',7,22,0,60,0,50,0,0,5,0,0,0,0,'C','U','B',0,1,1,25000,0,0,1),(44,'MEDICAL_TECHNICIAN','Medical Technician','Medical technician organizes work by matching computer orders with specimen labeling; sorting specimens; checking labeling; logging specimens; arranging reports for delivery; keeping work surfaces clean and orderly. Maintains quality results by running standards and controls, verifying equipment function through routine equipment maintenance and advanced trouble shooting; calibrating equipment utilizing approved testing procedures; monitoring quality control measures and protocols. Serves as technical resource by participating in staff training; answering questions of other professionals; participating in educational opportunities; reading professional publications; maintaining personal networks; participating in professional organizations.',70,'DEPARTMENT_MANAGER',7,22,0,60,0,40,0,0,5,0,0,0,0,'G','U','B',0,1,0,40000,0,0,1),(45,'NURSING_AID','Nursing Aid','Nursing aide provides hands-on care to patients in a variety of settings, including hospitals, nursing homes, and mental health facilities. Performs routine tasks under the supervision of registered nurses. Takes patient\'s temperate, pulse, and respiration rate. Takes blood pressure and determine if range is abnormal. Answers calls for help and determine if additional help is needed. Prepares and serve meals.',70,NULL,NULL,18,0,80,0,35,0,0,5,0,20,20,0,'H','B','F',0,1,0,30000,0,0,1),(46,'TRADITIONAL_MEDICINE_PRACTITIONER','Traditional Medicine Practitioner','Herbalist carrys out initial consultations with patients to diagnose a condition or illness. Carrys out physical tests and other assessments. Uses yknowledge of plant remedies to prescribe medicines appropriate for the treatment of a range of illnesses, with the aim of assisting the body\'s own healing properties (in some cases) grow, prepare and produce herbal medicines. Refers patients to other health practitioners, where appropriate. Uses a holistic approach to advise patients on diet and lifestyle. Undertakes follow-up appointments to assess patient progress. Maintains accurate patient records.',85,NULL,NULL,27,0,30,0,30,0,0,0,30,0,0,0,'N','R','B',0,1,0,40000,0,0,1),(47,'PRIMARY_TEACHERS_AID','Primary Teachers Aid','The Primary teachers aide provides support to children with mathematics, reading and writing on an individual, class or small group basis. Gives extra help to children with special needs or those for whom English is not their first language. Helps to develop programmes of learning activities and adapting appropriate materials. Motivates and encourages pupils. Assists with marking and correcting work. Attends meetings and reviews',70,NULL,NULL,18,0,70,0,20,0,0,5,0,10,20,0,'H','B','F',0,1,0,20000,0,0,1),(48,'NURSERY_SCHOOL_AID','Nursery School Aid','Nursery school aide assists the lead teacher in imparting classroom instruction based on predefined curriculum. Maintains a safe and organized classroom environment for children. Assists the lead teacher in ensuring the physical, social, cognitive and educational excellence of children. Ensures that the classroom is aesthetically attractive so that students enjoy their surroundings while learning lessons. Provides support to the lead teacher in planning lessons and daily activities based on the principles of child development. Observes each child to assess skills, interests and needs and use this information to facilitate individual learning and growth. Records any important observations regarding student development and ensure that it is communicated to the lead teacher.',70,NULL,NULL,18,0,80,0,20,0,0,5,0,10,20,0,'N','B','F',0,1,0,15000,0,0,1),(49,'SPECIAL_EDUCATION_TEACHING_AID','Special Education Teaching Aid','Special education teaching aide assists special education teacher in developing classroom curriculum based on individual students needs. Provides support in imparting specialized education based on lesson plans. Performs specialized tasks to achieve instructional and behavioral objectives. Assists special education teacher with behavior modification procedures. Assists students with personal care needs such as toileting, clothing, hygiene and washing up routines. Helps students with their mobility needs and ensure provision of a safe classroom environment. Provides instructions based on lesson plans and assist individual students in comprehending concepts. Monitors students during activities and downtime and intervene in case of adverse activities.',70,NULL,NULL,18,0,50,0,20,0,0,5,0,20,20,0,'H','B','B',0,1,0,20000,0,0,1),(50,'TEACHING_RESOURCE_AID','Teaching Resource Aid','Education resource aide assists in supporting and extending the focus of the school\'s programs, assists in maintaining a safe and nurturing environment, and supports and strengthens school community relations.  Provides an extension of the day by conducting large and small group tutoring and discussion groups before and after school. Assists in maintaining and supporting the daily instructional program by conducting psycho/perceptual motor classes throughout the school day. Assists in creating an additional instructional environment for students by providing and maintaining an area where students can do homework and receive assistance in skill development. Fosters a safe and nurturing environment, meeting with small and large groups outside of the classroom to promote and sustain appropriate behavior, and providing lessons in conflict resolution and behavior modification.',70,NULL,NULL,18,0,60,0,40,0,0,5,0,0,0,0,'